import React from "react";
import { Link } from "react-router-dom";

const EventsPage = () => {
  return (
    <>
      <h1 className="center">EventsPage</h1>
      <div className="center" style={"color: red"}>
        <Link to="">Event 1</Link>
        <Link to="">Event 1</Link>
        <Link to="">Event 1</Link>
      </div>
    </>
  );
};

export default EventsPage;
